pragma solidity 0.4.24;

import "openzeppelin-solidity/contracts/token/ERC20/ERC20.sol";
import "openzeppelin-solidity/contracts/token/ERC721/ERC721.sol";
import "./Types.sol";


library IsReceiveOk {
  // returns true if required ether are receivable
  function ethereum(Types.Item memory self, uint256 weiRemaining) private view returns (bool) {
    if (self.idOrAmount > weiRemaining) return false;
    // receiving ethereum, amount not enough

    return true;
  }

  // returns true if required tokens are receivable
  function erc20(Types.Item memory self) private view returns (bool) {
    uint256 allowedAmount = ERC20(self.contractAddr).allowance(self.owner, this);
    if (self.idOrAmount > allowedAmount) return false;
    // receiving erc20, amount not enough

    return true;
  }

  // returns true if required tokenId is receivable
  function erc721(Types.Item memory self) private view returns (bool) {
    address approved = ERC721(self.contractAddr).getApproved(self.idOrAmount);
    if (approved != address(this)) return false;
    // receiving erc721, not approved

    return true;
  }

  // returns true if required idORAmount is receivable
  function isReceiveOk(Types.Item memory self, uint256 weiRemaining) internal view returns (bool) {
    if (self.currencyType == Types.CurrencyType.ETHEREUM) return ethereum(self, weiRemaining);
    else if (self.currencyType == Types.CurrencyType.ERC20) return erc20(self);
    else if (self.currencyType == Types.CurrencyType.ERC721) return erc721(self);

    revert();
  }
}
